import React from 'react';
import RealTimeDataDisplay from './RealTimeDataDisplay';

function App() {
    return (
        <div className="container">
            <h1>Welcome to the Electricity Monitoring System</h1>
            <div className="dashboard">
                <h2>Electricity Data Dashboard</h2>
                <RealTimeDataDisplay />
            </div>
        </div>
    );
}

export default App;
